measurements.description:
Eleven lily form flowers on ten erect 8.4-cm to 12.4-cm inflorescences;  
   sepals light green blushed burgundy broadly along margins, veined burgundy, mid-vein dark burgundy;

   petals moderately porrect, green-cream, veins burgundy, three broad dark-burgundy medial veins;
  lip reflexed, ivory, side lobes heavily overlaid dark burgundy, mid-lobe proximal burgundy spot, blotched burgundy distally;
column yellow-cream, ventral surface blotched burgundy;   

	substance medium-firm; texture satiny.
